import React from 'react';
import WorkCard from './WorkCard';
import info from '../../data/info';

const Work = () => {
    return (
        <div>
            <div className="columns-3 gap-4">
                {info.work.map((work, index) => (
                    <div
                    key={index}
                    >
                        <WorkCard
                            title = {work.title}
                            photo = {work.photo}
                            angle = {work.angle}
                        />
                    </div>
                ))}
            </div>
        </div>

    );
}

export default Work;
